import React from 'react';
const SweetForm: React.FC = () => {
    return (
        <div className="text-center mt-5">
            <h2>Admin Sweet Form Placeholder</h2>
            <p>This is only accessible by administrators.</p>
        </div>
    );
};
export default SweetForm;
